trailingComments.value:
*
 * 打开客户端原创阅读页面
 *
 * 支持平台：书旗Android、书旗iOS
 *
 * @returns {Promise<*>}   成功1，失败0
 *
 * @example
 * const bookParams = {
 *   bookId: '6844527',
 *   bookName: '皇叔，公主要出局', // Android 用
 *   // chapterId: '734766', // iOS 定位时使用 ID 打开，暂不支持
 * };
 * libSQ.exec('read-original-Book', {
 *   params: bookParams,
 * }).catch((err) => {
 *   alert(`[read-original-book][error] ${JSON.stringify(err, null, 2)}`);
 *   const e = err.detail.__$rawError__;
 *   alert(e.message);
 *   alert(e.stack);
 * });
 *

